import Pagination from '@mui/material/Pagination';

const theme = {
    palette: {
        type: 'dark'
    }
};

const CustomPagination = ({ setPage, numOfPages }) => {

    const pageChanged = (page) => {
        setPage(page);
    }


    return (
        <div>
            <ThemeProvinder theme={theme} ></ThemeProvinder>
            <Pagination count={(numOfPages <= 500)? numOfPages : 500 } color="secondary"  onChange={(e) => pageChanged(e.target.textContent)} />

        </div>
    )
}

export default CustomPagination
